import React, { useState } from 'react';

const LiftLog = () => {
  const [lifts, setLifts] = useState([
    { lift: 'deadlift' },
    { lift: 'squat' },
    { lift: 'bench press' }
  ]);

  const [currentLift, setCurrentLift] = useState(lifts[0]);

  return (
    <div id="lift-log">
      <LiftSelector currentLift={currentLift} />
    </div>
  );
};

const LiftSelector = props => {
  return (
    <div id="lift-selector">
      <button type="button" className="arrow-button">
        &larr;
      </button>
      <h2>{props.currentLift}</h2>
      <button type="button" className="arrow-button">
        &#65291;
      </button>
    </div>
  );
};

export default LiftLog;
